        {
            where: {id}
        });
        res.json({
            message: 'Cuenta de banco actualizada',
            resultado: true,
            cuentas_bancos: cuentaBancoUpdate
        });
    }catch(e){
        console.log(e);
        res.json({
            resultado: false, 
            message: "Ha ocurrido un error, porfavor contactese con el administrador",
            cuentas_bancos: null
        });
    }
};

export const deleteCuentasBancos = async (req, res) => {
    try{
        const {id} = req.params;
        await cuentas_bancos.destroy({
            where: {
                id
            }
        });
        res.json({
            resultado: true, 
            message: 'Cuenta de banco eliminada correctamente'
        });
    }catch(e){
        console.log(e);
        res.json({
            resultado: false, 
            message: "Ha ocurrido un error, porfavor contactese con el administrador"
        });
    };
    
};

export const getAllCuentasBancos = async (req, res) => {
    try{
        const allCuentasBancos = await cuentas_bancos.findAll({
            attributes: [
                'id', 
                'numero_cuenta', 
                'nombre_banco',
                'swift_code',
                'codigo_iban',
                'referencia',
                'paises_id',
                'numeros_aba_id'
            ],
            order: [
                ['id', 'DESC']
            ]
        });
        res.json({
            resultado: true, 
            message: "",
            cuentas_bancos: allCuentasBancos
        });
    }catch(e){
        console.log(e);
        res.json({
            resultado: false, 
            message: "Ha ocurrido un error, porfavor contactese con el administrador", 
            cuentas_bancos: null
        });
    };
};

export const getCuentasBancosId = async (req, res) => {
    try{
        const {id} = req.params;
        const cuenta_banco = await cuentas_bancos.findOne({
            where: {
                id
            },
            attributes: [
                'id', 
                'numero_cuenta', 
                'nombre_banco',
                'swift_code',
                'codigo_iban',
                'referencia',
                'paises_id',
                'numeros_aba_id'
            ]
        });
        res.json({
            resultado: true, 
            message: "", 
            cuentas_bancos: cuenta_banco
        }); 
    }catch(e){
        console.log(e);
        res.json({
            resultado: false, 
            message: "Ha ocurrido un error, porfavor contactese con el administrador", 
            cuentas_bancos: null
        });
    };
};

